          "id": "fe384131f34e8df953659de7cd4931e7d2afb13d",
          "message": "[PERF] Add comprehensive benchmark suite (#53)\n\n* perf: add comprehensive benchmark suite for tokenizers\n\n- Add benchmark_test.go with benchmarks for all key operations\n- Use Go 1.24's testing.B.Loop() for accurate iteration handling\n- Include benchmarks for Encode, Decode, VocabSize, and loading operations\n- Test various text sizes (short, medium, long) and options\n- Add Makefile targets for running and comparing benchmarks\n- Install benchstat tool for performance regression detection\n\nResolves #8\n\nCo-Authored-By: Claude <noreply@anthropic.com>\n\n* fix: address PR feedback for benchmarks\n\n- Add missing newline at EOF in benchmark_test.go\n- Use b.Fatalf() instead of b.Skipf() for actual errors\n- Fix Go version inconsistency (examples/basic uses Go 1.24)\n- Created issue #54 for resource management improvements\n\nCo-Authored-By: Claude <noreply@anthropic.com>\n\n* feat: add continuous benchmarking CI workflow\n\n- Add GitHub Actions workflow for automated benchmarking\n- Run benchmarks on main branch and PRs\n- Store results using benchmark-action for trending\n- Compare PR performance against base branch\n- Alert on 20% performance regression\n- Upload artifacts for historical tracking\n\nCo-Authored-By: Claude <noreply@anthropic.com>\n\n* fix: skip decode benchmarks due to known issue #38\n\n- Add b.Skip() to BenchmarkDecode and BenchmarkEncodeDecode\n- Prevents CI failures from known decode crash with HuggingFace tokenizers\n- Will re-enable once issue #38 is resolved\n\nCo-Authored-By: Claude <noreply@anthropic.com>\n\n* fix: disable auto-push in benchmark CI to avoid gh-pages error\n\nThe benchmark-action was trying to push to a non-existent gh-pages branch.\nDisabled auto-push since we're uploading artifacts instead.\n\n* fix: add skip-fetch-gh-pages and pull-requests permission to benchmark CI\n\n- skip-fetch-gh-pages: true prevents benchmark-action from trying to fetch non-existent gh-pages branch\n- pull-requests: write permission allows posting benchmark comparison comments on PRs\n\n* fix: enable auto-push now that gh-pages branch exists\n\nNow that gh-pages branch has been created, re-enable auto-push\nto allow benchmark-action to store historical benchmark data.\n\n* fix: handle missing benchmarks in base branch gracefully\n\nWhen base branch (main) doesn't have benchmarks yet, the comparison\njob should continue instead of failing. This allows the benchmark CI\nto work for the first PR that adds benchmarks.\n\n---------\n\nCo-authored-by: Claude <noreply@anthropic.com>",
